class Solution:
    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """
        j = 0
        record = set([])
        last_length = 0
        while True:
            if s[j] not in record:
                record.add(s[j])
                j += 1
            else:
                ind = s[j-1::-1].index(s[j])
                last_length = len(record) if last_length < len(record) else \
                        last_length
                record.clear()
                j = j - ind

            if j == len(s):
                break
        return last_length if last_length > len(record) else len(record)


